(function($, Drupal) {
  Drupal.behaviors.sectionBgColorInvert = {
      attach: function(context, settings) {
          const debounce = (func, timeout=300) => {
              let timer
              return (...args) => {
                  clearTimeout(timer)
                  timer = setTimeout(() => {
                      func.apply(this, args)
                  }, timeout)
              }
          }
          const options = {
              rootMargin: '0px 0px -50% 0px'
          }
          const body = $('body')
          const bodyAddClass = () => {
              body.addClass('home')
              if (body.hasClass('home')) {
                  const sections = document.querySelectorAll('.sec-change-bg')
                  sections.forEach((el) => {
                      io.observe(el)
                  })
              }
          }
          const io = new IntersectionObserver((entries) => {
              entries.forEach((entry) => {
                  if (entry.intersectionRatio > 0) {
                      $(entry.target).parents('.field__item').prev('.field__item').find('section').addClass('sec-active-previous')
                      $(entry.target).addClass('sec-active')
                      $(entry.target).parents('.field__item').next('.field__item').find('section').addClass('sec-active-next')
                      const debouncedHandlers = () => {
                          $(entry.target).addClass('backgroundTransition')
                      }
                      if ($(entry.target).hasClass('sec-background-transition-helper'))
                          debounce(debouncedHandlers(), 500)
                  } else {
                      $(entry.target).parents('.field__item').prev('.field__item').find('section').removeClass('sec-active-previous')
                      $(entry.target).removeClass('sec-active')
                      $(entry.target).parents('.field__item').next('.field__item').find('section').removeClass('sec-active-next')
                      const debouncedHandlers = () => {
                          $(entry.target).removeClass('backgroundTransition')
                      }
                      if ($(entry.target).hasClass('sec-background-transition-helper'))
                          debounce(debouncedHandlers(), 500)
                  }
              })
          }, options)
          $(window).on('scroll', () => {
              bodyAddClass()
          })
      }
  }
})(jQuery, Drupal)
